/* eslint-disable no-unused-vars */
import React, { useContext, useEffect } from "react";
import { PokemonContext } from "../../contexts/PokemonContext";

import { css } from "@emotion/css";
import { GFONT, GMQ } from "../../styles/globalStyle";

const mq = GMQ.map((mq) => `@media (min-width: ${mq}px)`);

const PokemonListPage = () => {
  const { pokemons } = useContext(PokemonContext);

  return (
    <p
      className={`title ${css`
        ${mq[0]} {
          padding-top: 0.2rem;
          font-size: ${GFONT.SIZE2};
        }

        ${mq[3]} {
          padding-top: 0.4rem;
          font-size: ${GFONT.SIZE3};
        }
      `}`}
    >
      pokemons.length ? Currently you have {pokemons.length} pokemons in
      possession.{" "}
    </p>
  );
};

export default PokemonListPage;
